import React, { useState } from "react";
import MDBox from "components/MDBox";
import MDButton from "components/MDButton";
import Dialog from "@mui/material/Dialog";
import DialogActions from "@mui/material/DialogActions";
import DialogContent from "@mui/material/DialogContent";
import DialogContentText from "@mui/material/DialogContentText";
import DialogTitle from "@mui/material/DialogTitle";
import TextField from "@mui/material/TextField";
import {
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
} from "@mui/material";
import DataTable from "examples/Tables/DataTable";
import DeleteIcon from "@mui/icons-material/Delete";
import VisibilityIcon from "@mui/icons-material/Visibility";
export default function StaffEntryTable({ staffData }) {
  const [viewData, setViewData] = useState([]);
  const [open, setOpen] = React.useState(false);
  const handleClose = () => setOpen(false);
  let jsondata;
  const handleView = async (ID) => {
    try {
      const response = await fetch(`http://localhost:5001/viewStaff/${ID}`);
      jsondata = await response.json();

      setViewData(jsondata);
    } catch (error) {
      console.error("Error fetching questions:", error);
    }
  };
  const handleDelete = async (ID) => {
    try {
      const response = await fetch(`http://localhost:5001/staffDelete/${ID}`);
      const result = await response.json();
      staffData();
    } catch (error) {
      console.error("Error fetching  awareness program:", error);
    }
  };
  const columns = [
    { Header: "Name", accessor: "name", width: "45%", align: "left" },
    { Header: "Staff ID", accessor: "id", align: "left" },
    { Header: "email", accessor: "email", align: "center" },
    { Header: "Domain", accessor: "domain", align: "center" },
    { Header: "DOJ", accessor: "doj", align: "center" },
    { Header: "Action", accessor: "action", align: "center" },
  ];

  const rows = staffData.map((data) => ({
    name: data.staff_name,
    id: data.staff_id,
    email: data.staff_email, // Add logic to calculate difficulty if neede
    domain: data.Domain,
    doj: data.DOJ, // Add logic to calculate creation date if needed
    action: (
      <MDBox>
        <MDButton onClick={() => handleDelete(data.staff_id)} color="error">
          <DeleteIcon />
        </MDButton>
        <MDButton onClick={() => handleView(data.uid)} color="info">
          <VisibilityIcon />
        </MDButton>
      </MDBox>
    ),
  }));
  return (
    <MDBox pt={3}>
      <Dialog
        maxWidth="lg"
        open={open}
        sx={{ width: "auto" }}
        justifyContent="center"
        onClose={handleClose}
      >
        <DialogTitle>Question List</DialogTitle>
        <DialogContent>
          <DialogContentText>
            <MDBox
              component="form"
              sx={{ width: "auto", height: "auto", textAlign: "center" }}
              noValidate
              autoComplete="off"
            ></MDBox>
          </DialogContentText>
          <MDBox
            component="form"
            sx={{ width: "auto", height: "auto", textAlign: "center" }}
            noValidate
            autoComplete="off"
          >
            <table>
              <thead>
                <tr>
                  <th>Question ID</th>
                  <th>Question Text</th>
                  <th>Sample Input</th>
                  <th>Sample Output</th>
                  <th>Hidden InputTest CaseI</th>
                  <th>Hidden OutputTest CaseI</th>
                  <th>Hidden Input TestCaseII</th>
                  <th>Hidden Output TestCaseII</th>
                  <th>Hidden Input TestCaseIII</th>
                  <th>Hidden Output TestCaseIII</th>
                  <th>Constraints</th>
                  <th>Time Limit</th>
                  <th>Storage Limit</th>
                </tr>
              </thead>
              <tbody>
                {jsondata &&
                  jsondata.map((question) => (
                    <TableRow key={question.QuestionID}>
                      <TableCell>{question.QuestionID}</TableCell>
                      <TableCell>{question.QuestionText}</TableCell>
                      <TableCell>{question.SampleInput}</TableCell>
                      <TableCell>{question.SampleOutput}</TableCell>
                      <TableCell>{question.HiddenInputTestCaseI}</TableCell>
                      <TableCell>{question.HiddenOutputTestCaseI}</TableCell>
                      <TableCell>{question.HiddenInputTestCaseII}</TableCell>
                      <TableCell>{question.HiddenInputTestCaseII}</TableCell>
                      <TableCell>{question.HiddenInputTestCaseIII}</TableCell>
                      <TableCell>{question.HiddenOutputTestCaseIII}</TableCell>
                      <TableCell>{question.Constraints}</TableCell>
                      <TableCell>{question.TimeLimit}</TableCell>
                      <TableCell>{question.StorageLimit}</TableCell>
                      {/* Add more TableCell components for additional question details */}
                    </TableRow>
                  ))}
              </tbody>
            </table>
          </MDBox>
        </DialogContent>
        <DialogActions>
          <MDButton onClick={handleCodingClose} color="primary">
            Cancel
          </MDButton>
          <MDButton onClick={handleClose} color="primary" autoFocus>
            Save
          </MDButton>
        </DialogActions>
      </Dialog>
      <DataTable
        table={{ columns, rows }}
        isSorted={false}
        entriesPerPage={false}
        showTotalEntries={false}
        noEndBorder
      />
    </MDBox>
  );
}
